import './App.css';
import MyDrawer from './components/MyDrawer';
import { BrowserRouter as Router, Switch, Route} from "react-router-dom";
import { Dashboard } from './components/dashboard/Dashboard'
function App() {

  return (
    <Router>
    <div className="App">
      <MyDrawer/>
      <Switch>
        <Route path="/Dashbord" component={Dashboard} />
      </Switch>
    </div>
    </Router>
  );
}

export default App;
